import React from 'react'
import Footer from '../components/footer/Footer'
import Header from '../components/header/Header'
import bImage from '../../public/img/blog/poukazka-LenkaDesign_large.jpg'

function Poukaz() {
  const MyStyle = {
    backgroundImage: `url(${bImage})`
  }
  return (
    <>
    <Header />
    <div className="pozvanka-block" style={{backgroundImage: url(img/blog/poukazka-LenkaDesign_large.jpg)}}>
            <p>Pokud máte zájem, je možné si zakoupit dárkový  poukaz.</p>
            <div className="poukazka"></div>
        </div>
    <Footer />
    </>

  )
}

export default Poukaz
